// LoginForm.js
import React from 'react';

const LoginForm = () => {
  const usernameRegex = /^[a-zA-Z0-9_-]{3,16}$/;

  const handleLogin = (e) => {
    e.preventDefault();
    const usernameInput = e.target.elements.username.value;
    const passwordInput = e.target.elements.password.value;

    // Validate username using regex
    if (!usernameRegex.test(usernameInput)) {
      alert('Please enter a valid username (3-16 characters, alphanumeric or underscore).');
      return;
    }

    // Other validation logic as needed

    // Perform login logic
    console.log('Login:', { username: usernameInput, password: passwordInput });
  };

  return (
    <form onSubmit={handleLogin} className="needs-validation" noValidate>
      <div className="form-group0">
        <label htmlFor="username">Username:</label>
        <input type="text" className="form-control" id="username" required />
        <div className="invalid-feedback">Please enter a valid username (3-16 characters, alphanumeric or underscore).</div>
      </div>
      <div className="form-group0">
        <label htmlFor="password">Password:</label>
        <input type="password" className="form-control" id="password" required />
        <div className="invalid-feedback">Please enter a password.</div>
      </div>
      <button type="submit" className="btn btn-primary">Login</button>
    </form>
  );
};

export default LoginForm;
